# Helper functions

def genSlowpokeMiniMax(plyCount=4):
    bot = sp.Slowpoke(plyDepth=plyCount, minimax=True)
    bot.loadWeights(coef_91_gm)
    return bot

def genSlowpokeClass(plyCount=4, bot_layers=[91,40,10,1], weights=[]):
    bot = sp.Slowpoke(plyDepth=plyCount, layers=bot_layers)
    if len(weights) > 0:
        bot.loadWeights(weights)
    return bot

def generatePlayerOptions(plyCount=6):
    playerTypes = {
        'magikarp' : {
            "description" : "It plays randomly.",
            "class" : ma.Magikarp()
        },
        'human' : {
            "description" : "Human player.",
            "class" : human.Human()
        },
        'slowpoke_rand' : {
            "description" : "This slowpoke uses a random set of weights. Also uses subsquares.",
            "class" : genSlowpokeClass(plyCount)
        },
        'slowpoke' : {
            "description" : "Slowpoke is a bot. (Gold Master)",
            "class" : genSlowpokeClass(plyCount, weights=coef_91_gm)
        },
        'slowpoke_0' : {
            "description" : "This slowpoke uses the first generation's weights. Also uses subsquares.",
            "class" : genSlowpokeClass(plyCount, weights=coef01_0)
        },
        'slowpoke_99' : {
            "description" : "Slowpoke is a bot. (Weights are from the 99th generation)",
            "class" : genSlowpokeClass(plyCount, weights=coef_91_99)
        },
        'slowpoke_149' : {
            "description" : "Slowpoke is a bot. (Weights are from the 149th generation)",
            "class" : genSlowpokeClass(plyCount, weights=coef_91_149)
        },
        'slowpoke_nosb' : {
            "description" : "Slowerpoke is a slowpoke that doesn't use subsquares.",
            "class" : genSlowpokeClass(plyCount, bot_layers=[32,40,10,1], weights=coef32)
        },
        'slowpoke_minimax' : {
            "description" : "This slowpoke is a GM, but uses minimax instead",
            "class" : genSlowpokeMiniMax(plyCount)
        }
    }
    return playerTypes

